import "bootstrap/dist/css/bootstrap.min.css"
import './App.css'
import { Route, Routes } from 'react-router-dom';
import Home from './Pages/Home'


function App() {
  return (
    <Routes>
        <Route path='/' element={<Home />} exact />

    </Routes>
  );
}

export default App;
